import * as s from '../styles/FishAdoptionStyle';

const FishAdoption = ({ data }: any) => {
  return (
    <s.FishAdoptionContainer>
      <s.FishAdoptionHeader>
        <s.FishAdoptionPrice>1,000,000원</s.FishAdoptionPrice>
      </s.FishAdoptionHeader>
      <s.FishAdoptionBody>
        <s.FishAdoptionQuantity>수량</s.FishAdoptionQuantity>
        <s.FishAdoptionQuantitySelectorArea>
          <s.FishAdoptionQuantitySelectorButton>-</s.FishAdoptionQuantitySelectorButton>
          <s.FishAdoptionQuantitySelectorInput>1</s.FishAdoptionQuantitySelectorInput>
          <s.FishAdoptionQuantitySelectorButton>+</s.FishAdoptionQuantitySelectorButton>
        </s.FishAdoptionQuantitySelectorArea>
      </s.FishAdoptionBody>
      <s.FishAdoptionButtonContainer>
        <s.FishAdoptionButton>장바구니</s.FishAdoptionButton>
        <s.FishAdoptionButton>바로구매</s.FishAdoptionButton>
      </s.FishAdoptionButtonContainer>
    </s.FishAdoptionContainer>
  );
};

export default FishAdoption;
